 const { jsPDF } = window.jspdf;

    function tranformaTexto(texto){
        return texto.toLowerCase().split(" ").map(palavra => {
            return palavra.charAt(0).toUpperCase() + palavra.slice(1);
        }).join(' ');
    }




async function generatorCard(){
    const name = document.getElementById('input-name').value;
    const matricula = document.getElementById('input-namber').value;
    const cpf = document.getElementById('input-cpf').value;

console.log(name)

    const nomeTransfonrm = tranformaTexto(name);



    const doc = new jsPDF({
        orientation: "landscape",
        unit: "mm",
        format: [85,54]
    });

    const cartaoFrente = "data:image/png;base64,"

    const cartao_verso = "data:image/png;base64,"

    doc.addImage(cartaoFrente, 'PNG', 0, 0, 85,54);
    
    doc.setFont("helvetica", "bold");
    doc.setFontSize(12);
    doc.text(nomeTransfonrm, 15, 47);

    doc.setFont("helvetica", "bold");
    doc.setFontSize(8);
    doc.text(`Mat: ${matricula}`, 15, 52);
    doc.text(`CPF: ${cpf}`,42,52);

   

    doc.addPage();
    doc.addImage(cartao_verso, 'PNG', 0, 0, 85, 54);


     doc.save("cartao_teste.pdf");

}

